import React from 'react';
import confLogo from '../images';



class Badge extends React.Component {
    render(){
        return (
            <div>
                <div>
                    <img src={confLogo} alt="logo"/>
                </div>

                <div>
                    <img src="https://www.gravatar.com/avatar?d=identicon" alt="Avatar"/>
                    <h1>
                        David <br/> Castro 
                    </h1>
                </div>
            </div>
        )
    }
}


export default Badge;
